window.bookSummaryJSON = "<p>\"Love had been given and taken and now...it had been stolen. No one steals from a thief - especially from me - and I will defend what's mine until my dying breath. It's not a question of what I'm willing to sacrifice but who to deserve her....\"</p> <p>Once upon a time, I stupidly believed if I could make Elder fall for me, everything would be perfect. Now, I'm missing, and he's hunting, and everything is far from our happily ever after. He gave me his heart, and I gave him my promise, but true love isn't sacred to others. War is coming, disaster is brewing, and I'm not going down without a fight.</p> <p>Elder is mine. I am his. And no one can keep us apart.</p> <p>Fifth and final book in the <i>USA Today</i> best-selling series.</p>"; 
